import React from "react";
import CenteredColumns from "components/CenteredColumns";
import Avatar from "components/Avatar";
import "components/TeamBios.scss";

function TeamBios(props) {
  return (
    <CenteredColumns>
      {props.people.map((person, index) => (
        <div
          className="TeamBios__column column is-half-tablet is-one-third-desktop is-flex"
          key={index}
        >
          <div className="TeamBios__card card is-flex">
            <div className="TeamBios__card-content card-content is-flex has-text-centered">
              <div className="TeamBios__avatar-wrapper">
                <Avatar
                  image={person.avatar}
                  size={128}
                  alt={person.name}
                ></Avatar>
              </div>
              <div className="TeamBios__details">
                <p className="TeamBios__name is-size-5">{person.name}</p>
                <p className="TeamBios__role is-size-7 is-uppercase has-text-weight-semibold">
                  {person.role}
                </p>
                <p className="TeamBios__bio">{person.bio}</p>
              </div>
            </div>
          </div>
        </div>
      ))}
    </CenteredColumns>
  );
}

export default TeamBios;
